import connectDB from '../../../utils/connectDB'

connectDB()

export default async (req, res) => {
    switch (req.method) {
        case 'GET':
            return await getProducts(req, res)
        default:
            break;
    }
}

const getProducts = async (req, res) => {
    try {
        console.log(res);
        const data = await res.status(400).json({
            products: res.json
        })
    } catch (err) {

    }

}
